import React from 'react';
import './BuyerDashboard.css'; 

const BuyerDashboard = () => {
  return (
    <div className="buyer-dashboard">
      {/* Header with shopping cart */}
      <header className="header">
        <h1>NomiShop online</h1>
        <div className="cart">
          <button>Shopping Cart</button>
        </div>
      </header>

      {/* Sliding message */}
      <section className="sliding-message">
        <div className="message">Big Sale! Up to 50% off on selected items!</div>
      </section>

      
      {/* Categories Navbar */}
      <nav className="categories-navbar">
        <button className="nav-item">Electronics</button>
        <button className="nav-item">Clothing</button>
        <button className="nav-item">Home & Kitchen</button>
        <button className="nav-item">Books</button>
      </nav>

      {/* Product Showcase */}
      <section className="product-showcase">
        <h2>Featured Products</h2>
        <div className="product-list">
          <div className="product-item">Product 1</div>
          <div className="product-item">Product 2</div>
          <div className="product-item">Product 3</div>
          <div className="product-item">Product 4</div>
        </div>
      </section>
    </div>
  );
};

export default BuyerDashboard;
